// Computes the difference between 'old' and 'new' objects in input
const results = [];

function getDiff(o1, o2) {
  return Object.keys(o2).reduce((diff, key) => {
    if (o1[key] === o2[key]) return diff;
    return {
      ...diff,
      [key]: o2[key]
    };
  }, {});
}

for (const item of items) {
  const oldObj = item.json.old || {};
  const newObj = item.json.new || {};
  results.push({ json: getDiff(oldObj, newObj) });
}

return results;
